 Here is a simple React popup component that can be used as a module:
```jsx
import React, { useState } from 'react';

const Popup = ({ title, message, onClose }) => {
  const [isOpen, setIsOpen] = useState(true);

  const handleClose = () => {
    setIsOpen(false);
    onClose();
  };

  return (
    <div className={`popup ${isOpen ? 'active' : ''}`}>
      <div className="popup-content">
        <h2>{title}</h2>
        <p>{message}</p>
        <button onClick={handleClose}>Close</button>
      </div>
    </div>
  );
};

export default Popup;
```
You can use it in your app like this:
```jsx
import React from 'react';
import Popup from './Popup';

const App = () => {
  const [isPopupOpen, setIsPopupOpen] = useState(false);

  const handlePopupClose = () => {
    setIsPopupOpen(false);
  };

  return (
    <div>
      <button onClick={() => setIsPopupOpen(true)}>Open Popup</button>
      {isPopupOpen && <Popup title="Popup Title" message="This is a popup message" onClose={handlePopupClose} />}
    </div>
  );
};

export default App;
```
