import express from 'express';
import path from 'path';

const app = express();

// Serve static files from the react app directory
app.use(express.static(path.join(__dirname, 'reactApp')));

// Start the server
const PORT = 3000;
app.listen(PORT, () => {
  console.log(`Server started on port ${PORT}`);
});
```
