 Here's a JavaScript function that generates and draws Pascal's triangle in an HTML canvas:
```html
<!DOCTYPE html>
<html>
  <head>
    <title>Pascal's Triangle</title>
  </head>
  <body>
    <canvas id="pascalsTriangle"></canvas>

    <script>
      const canvas = document.getElementById('pascalsTriangle');
      const ctx = canvas.getContext('2d');

      function drawPascalsTriangle(n) {
        if (n === 0 || n === 1) {
          // Base cases: 0 and 1
          ctx.fillStyle = '#000';
          ctx.fillRect(0, 0, canvas.width, canvas.height);
          return;
        }

        // Generate the triangle
        const res = [];
        for (let i = 0; i <= n; i++) {
          res.push(Array(i + 1).fill(0));
          for (let j = 0; j <= i; j++) {
            res[i][j] = res[i - 1][j] + res[i - 1][j - 1];
          }
        }

        // Draw the triangle
        for (let i = 0; i < n; i++) {
          for (let j = 0; j < i + 1; j++) {
            ctx.fillStyle = res[i][j] === 0 ? '#eee' : '#000';
            ctx.fillRect(j, i, 1, 1);
          }
        }
      }

      // Draw the triangle with n = 5
      drawPascalsTriangle(5);
    </script>
  </body>
</html>
